export default function Lol() {
  return (
    <div
      style={{
        width: "98.6%",
        alignItems: "center",
        justifyContent: "center",
        display: "flex",
        flexDirection: "column",
        position: "relative",
      }}
    >
        <h1>Certificate</h1>
    </div>
  );
}
